import React from 'react';
import Img from './Img';

const ImgList = props => {
	const results = props.data;
	let imgs = results.map(img => <Img url={img.urls.small} key={img.id}/>);
	i
	return (
		<ul className="img-list">
			{imgs}
		</ul>
	);
};

export default ImgList;
